public final int hashCode() {
  final int prime = 31;
  final int bits = 32;
  int result = 1;
  int jobHash = 0;
  if (jobId == null) {
    jobHash = 0;
  } else {
    jobHash = jobId.hashCode();
  }
  result = prime * result + jobHash;
  result = prime * result + (int) (taskId ^ (taskId >>> bits));
  return result;
}
